import React, {Component, useState} from "react";
import axios from "axios";
import {Register} from "./Register";
export function Login(){
    const[credentials, setCredentials] = useState()
    const[isRegSet , setRegFlag] = useState(false)
    const submitresponse = (event) =>{
        alert('login page created successfully')

        event.preventDefault()
    }

    const register =(event) => {
        //alert('register')
        setRegFlag(true)
        event.preventDefault()
    }


    return (
            <div>
            <form onSubmit={this.submitresponse}>
                <label>Username: </label>
                <input type='text' onChange={(e)=>{setCredentials({...credentials, username:e.target.value})}}/>

                <label>Password: </label>
                <input type='password' onChange={(e)=>{setCredentials({...credentials, password:e.target.value})}}/>

                <label>Type: </label>
                <select onChange={(e)=>{setCredentials({...credentials, type:e.target.value})}}>
                    <option value='Cust'>Customer</option>
                    <option value='part'>Partner</option>
                    <option value='Del'>Delivery</option>
                </select>
                <input type='submit' value='Login' onChange={this.submitresponse}/>
            </form>
                <input type='button' value='Register' onClick={this.register}/>
                {isRegSet && <Register/>}
        </div>
        );

}
export default Login
